import React from 'react';

import {
    DrawerContentScrollView,
    DrawerItem
} from '@react-navigation/drawer';
import { Text, View } from 'react-native';

const DrawerContent = (props)=>{
    return(
        <View>
            <Text>Test Content</Text>
        </View>
    )
}

export default DrawerContent;
